import React from "react";
import { NavLink } from "react-router-dom";
import { Header, HeaderRow, Textfield, Navigation } from "react-mdl";

const NavbarHeader = () => {
  return (
    <Header
      waterfall
      hideTop
      scroll
      className="mdl-shadow--16dp"
      style={{ background: "#111" }}
    >
      <HeaderRow
        title={
          <img
            src="https://academystack.com/coming-soon/images/academystacklogowithoutsloganinwhitebackground-70.png"
            alt="logo"
            className="logo"
          />
        }
      >
        <Textfield
          value=""
          onChange={() => {}}
          label="Search3"
          expandable
          placeholder="Search anything"
          expandableIcon="search"
        />
      </HeaderRow>
      <HeaderRow>
        <Navigation>
          <NavLink to="/">Top Rated</NavLink>
          <NavLink to="/">Action Movies</NavLink>
          <NavLink to="/">Horror Movies</NavLink>
          <NavLink to="/">Comedy Movies</NavLink>
          <NavLink to="/">Documentaries</NavLink>
        </Navigation>
      </HeaderRow>
    </Header>
  );
};

export default NavbarHeader;
